    [],nt"num_tags": 9,nt"name": "hawaiian-islands-national-wildlife-refuge-narrative-report-1988-calendar-year",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Hawaiian
    Islands NWR outlines Refuge accomplishments during the 1988 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands and pest control. The wildlife
    section of the report discusses endangered and threatened species, waterfowl, shorebirds,
    raptors, marine mammals, scientific collections, animal control, and marking and
    banding. The public uses of the Refuge described in this report include interpretive
    programs and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, and energy conservation.",nt"owner_org":
